import{_ as e,o as t,c as o,O as r}from"./chunks/framework.9482e208.js";const _=JSON.parse('{"title":"§ 55.1-2607 Status of property loaned to or deposited with museum prior to July 1, 2002.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/55.1-2607.md","filePath":"vacode/55.1-2607.md"}'),a={name:"vacode/55.1-2607.md"},i=r('<h1 id="§-55-1-2607-status-of-property-loaned-to-or-deposited-with-museum-prior-to-july-1-2002" tabindex="-1">§ 55.1-2607 Status of property loaned to or deposited with museum prior to July 1, 2002. <a class="header-anchor" href="#§-55-1-2607-status-of-property-loaned-to-or-deposited-with-museum-prior-to-july-1-2002" aria-label="Permalink to &quot;§ 55.1-2607 Status of property loaned to or deposited with museum prior to July 1, 2002.&quot;">​</a></h1><p>Except as otherwise provided in a written agreement between a lender and a museum, property loaned to or deposited with a museum prior to July 1, 2002, may be discarded or transferred to another museum located in Virginia, provided that (i) the notice provisions of §§ <a href="/vacode/55.1-2604/">55.1-2604</a> and <a href="/vacode/55.1-2605/">55.1-2605</a> have been complied with and (ii) such property is held by the museum receiving the transfer for at least three years before it sells or disposes of such property.</p><p>2005, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?051+ful+CHAP0480" target="_blank" rel="noreferrer">480</a>, § 55-210.38; 2019, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?191+ful+CHAP0712" target="_blank" rel="noreferrer">712</a>.</p>',3),s=[i];function d(p,n,l,u,c,h){return t(),o("div",null,s)}const f=e(a,[["render",d]]);export{_ as __pageData,f as default};
